values:
Ok, I am 48, never really had a job more than 9 months (thought that was how you got pregnant&lt;&lt;&lt; at least that was whenever I got a job I got pregnant, stopped that reeally quick. lol) Was a stay at home mom for the longest time but for some reason no one wants a retired stay at&nbsp;home mom working in their office.&nbsp;&nbsp;
Did find one that may work, after all those years of keeping score and following all the kids through sports.

SPORTS SCORETAKER Duties will include taking phone calls from coaches and building prep roundups, working up sports agate from the national wire, and covering prep and college baseball games on a limited basis. The successful candidate should understand sports and statistics, write well and pay close attention to detail.&nbsp;

Wish me luck, sounds like something I could soak my teeth in. Also tested at CMS and got some good test scores for other state jobs, we'll see.
